import React, { useEffect, useState } from "react";
import "./styles.scss"

export function CarList(){
    const[cars, setCars] = useState(null);

    useEffect(() => {
        fetch("http://127.0.0.1:8000/")
            .then(res => {
                return res.json();
            })
            .then(data => {
                setCars(data);
            });
    }); 

    return(
    <h1 className = "heading-list">ALL MODELS</h1>
    );
}
